import React, { Component } from "react";
import { Row, Col, Card, Button, Icon, Progress,Table } from "antd";
import ReactApexChart from 'react-apexcharts';

import ChartBreakdownDonut from "./ChartBreakdownDonut";
import LineChart from "./LineChart";
import BarChart from "./BarChart";


const DataSet = require("@antv/data-set");




    class ManagementAllCharts extends React.Component {

      constructor(props) {
        super(props);

        this.state = {
         cat:['Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct'],

        area_chart_series:[{
            name: 'series1',
            data: [31, 19, 30,2,3,4,5,6,7,8,91,2,3,4,5,67,8]
          }, {
            name: 'series2',
            data: [30, 24, 56,9,65,313,14,5]
          }],
        }
      }



      render() {

      const area_chart_options = {
            chart: {
              stacked: true,

            },
            colors: ['#008FFB', '#00E396', '#CED4DC'],
            dataLabels: {
              enabled: false
            },
            stroke: {
              show: true,
              width: 2,
              colors: ['transparent']
            },
            xaxis: {
              categories: [this.state.cat],
            },
            fill: {
              type: 'gradient',
              gradient: {
                opacityFrom: 0.6,
                opacityTo: 0.8,
              }
            },
            legend: {
              position: 'top',
              horizontalAlign: 'left'
            },

          }



        return (


          <div id="chart">
            <ReactApexChart options={area_chart_options} series={this.state.area_chart_series} type="area"  width="600" height="350" />
          </div>


        );
      }
    }
export default ManagementAllCharts;
